const e=JSON.parse('{"key":"v-79c1c4c1","path":"/note/golang/open-source-books/the-way-to-go/06/06.12.html","title":"6.12 通过内存缓存提升性能","lang":"zh-CN","frontmatter":{},"headers":[],"git":{"updatedTime":1684038853000},"readingTime":{"minutes":0.99,"words":298},"filePathRelative":"note/golang/open-source-books/the-way-to-go/06/06.12.md","excerpt":"<h1> 6.12 通过内存缓存提升性能</h1>\\n<p>通过在内存中缓存和重复利用相同的计算结果，称之为内存缓存。</p>\\n<p>以 fibonacci 数列为例，计算第n个数字需要前两个数字，而前两个数字已经计算过了，将其缓存在内存中可提升速度。</p>"}');export{e as data};
